import React from "react";
import { Card, Descriptions, Avatar, ConfigProvider } from 'antd';

const Profile = ({ userData }) => {
    return (
        <ConfigProvider
        theme={{
            token:{
                colorBgContainer:'linear-gradient(90.21deg, #f144ce -5.91%, #4529c1 111.58%)',
                colorBorderSecondary:'rgba(157, 62, 240, 0.945)',
                colorText:'black',
                colorTextDescription:'black'
            }
        }}

        >
            <Card
            title="Kullanıcı Profili"
            bordered={true}
            style={{ width: 450, margin: '50px' }}
        >
            <div style={{ display: 'flex', justifyContent: 'center', marginBottom: '30px' }}>
                <Avatar
                    size={158}
                    src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSFq_XICspIbMdmG2muTxEwmrZfmtUn0TDdT1rq3CP-MsHNyuBDCMhSnV9Phd8QnGNr9Uo&usqp=CAU"
                />
            </div>
            <Descriptions column={1} bordered>
                <Descriptions.Item label="İsim">{userData.User}</Descriptions.Item>
                <Descriptions.Item label="E-Posta">{userData.Email}</Descriptions.Item>
                <Descriptions.Item label="Telefon">{userData.Telephone}</Descriptions.Item>
                <Descriptions.Item label="Adres">{userData.Address}</Descriptions.Item>
            </Descriptions>
        </Card>
        </ConfigProvider>
    );
}

export default Profile;
